import React from 'react';

const Request = (props) => {
  const domain = 'localhost:80';
  const route = [];
  route['module'] = undefined !== props.route.split(/\//)[0] ? props.route.split(/\//)[0] : null;
  route['action'] = props.route.split(/\//)[1] ? props.route.split(/\//)[1] : null;
  route['param'] = props.route.split(/\//)[2] ? props.route.split(/\//)[2] : null;
  let finalRoute = '';
  for (let routePart of route) {
    null !== routePart ? finalRoute += routePart : '';
  }
  const method = props.method;
  const data = props.data;
  const JSONResponse = null;
  fetch(domain + route, {
    method: method,
    headers: 'POST' === method ? {
      'Accept': 'application/json',
      'Content-Type': 'application/json'
    } : null,
    body: 'POST' === method ? JSON.stringify(data) : null
  })
  .then(response => response.json())
  .then(jsonResponse => JSONResponse = jsonResponse)
  .catch(networkError => console.log(networkError));
  return <div/>;
}

export default Request;
